import React from "react";
import "./styles.css";
import About from "./pages/About";
import Categorical from "./pages/Categorical";
import GenderCrimes from "./pages/GenderCrimes";
import GenderCrimesVsNonGenderCrimes from "./pages/GenderCrimes";
import IncomeRelatedVariables from "./pages/IncomeRelatedVariables";
import VizNavigation from "./components/VizNavigation";
import TimeSeries from "./pages/TimeSeries";
import DatasetOverview from "./pages/DatasetOverview";
import Spatial from "./pages/Spatial";
import ExamplePage from "./pages/ExamplePage";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import './App.scss';
/*
Content across website:
    -  Navigation Bar (VizNavigation)
    -  Links to Pages Related to Specific Variables
    -  Footer (TBD)
*/

/*
Important note:
  only the pages created so far will show actual content. Everything else directs to the Example Page, which is just pictures of cats :)
*/
export default function App() {
  return (
    <Router>
      <div className="App">
        <VizNavigation />
        <Routes>
          <Route path="/" exact element={<About></About>} />
          <Route path="/arrests" element={<ExamplePage/>} />
          <Route path="/gender-violence" element={<ExamplePage/>} />
          <Route path="/gender-crime-against-crime-overall" element={<ExamplePage/>} />
          <Route path="/income-and-crime-rates" element={<ExamplePage/>} />
          <Route path="/crime-rates-over-time" element={<ExamplePage/>} />
          <Route path="/about-the-data" element={<ExamplePage/>} />
          <Route path="/crime-rates-by-zipcode-last-year" element={<ExamplePage/>} />
          <Route path="/crime-rates-by-zipcode-last-month" element={<ExamplePage/>} />
          <Route path="/crime-rates-by-zipcode-over-time" element={<ExamplePage/>} />
          <Route path="/example" component={ExamplePage} />

        </Routes>
      </div>
    </Router>
  );
}
